CREATE TABLE `raw_baseball_data` (
  `ID` int(20) NOT NULL AUTO_INCREMENT,
  `MLB_ID` int(20) NOT NULL,
  `NAME` varchar(255) NOT NULL,
  `TEAM` varchar(45) NOT NULL,
  `GAME` varchar(45) NOT NULL,
  `GAME_NO` varchar(45) NOT NULL,
  `RESULT` varchar(45) NOT NULL,
  `HITTER_PITCHER` varchar(45) NOT NULL,
  `STARTER` varchar(45) DEFAULT NULL,
  `AB` int(11) NOT NULL DEFAULT '0',
  `H` int(11) NOT NULL DEFAULT '0',
  `2B` int(11) NOT NULL DEFAULT '0',
  `3B` int(11) NOT NULL DEFAULT '0',
  `HR` int(11) NOT NULL DEFAULT '0',
  `R` int(11) NOT NULL DEFAULT '0',
  `RBI` int(11) NOT NULL DEFAULT '0',
  `BB` int(11) NOT NULL DEFAULT '0',
  `IBB` int(11) NOT NULL DEFAULT '0' COMMENT 'Intentional Walks',
  `HBP` int(11) NOT NULL DEFAULT '0' COMMENT 'Hit by Pitch',
  `SO` int(11) NOT NULL DEFAULT '0',
  `SB` int(11) NOT NULL DEFAULT '0',
  `CS` int(11) NOT NULL DEFAULT '0' COMMENT 'Cuaght Stealing',
  `PICKED_OFF` int(11) NOT NULL DEFAULT '0',
  `SH` int(11) NOT NULL DEFAULT '0' COMMENT 'Sacrificial Hit',
  `SF` int(11) NOT NULL DEFAULT '0' COMMENT 'Sacrificial Fly',
  `E` int(11) NOT NULL DEFAULT '0' COMMENT 'Error',
  `PB` int(11) NOT NULL DEFAULT '0' COMMENT 'Passed Ball',
  `LOB` int(11) NOT NULL DEFAULT '0' COMMENT 'Left On Base',
  `GIDP` int(11) NOT NULL DEFAULT '0' COMMENT 'Ground Into Double Play',
  `IP` int(11) NOT NULL DEFAULT '0' COMMENT 'Innings Pitched',
  `HA` int(11) NOT NULL DEFAULT '0' COMMENT 'HITS_ALLOWED',
  `RA` int(11) NOT NULL DEFAULT '0' COMMENT 'Runs Allowed',
  `ER` int(11) NOT NULL DEFAULT '0' COMMENT 'Earned Runs',
  `WK` int(11) NOT NULL DEFAULT '0' COMMENT 'Walks Allowed',
  `IWK` int(11) NOT NULL DEFAULT '0' COMMENT 'Intentional Walks',
  `K` int(11) NOT NULL DEFAULT '0' COMMENT 'Strikeout',
  `HB` int(11) NOT NULL DEFAULT '0' COMMENT 'Hit Batsmen',
  `PICKOFFS` int(11) NOT NULL DEFAULT '0' COMMENT 'Successful Pickoffs by Pitcher',
  `HR_ALLOWED` int(11) NOT NULL DEFAULT '0',
  `WP` int(11) NOT NULL DEFAULT '0' COMMENT 'Wild Pitch',
  `WIN` int(11) NOT NULL DEFAULT '0',
  `LOSS` int(11) NOT NULL DEFAULT '0',
  `SAVE` int(11) NOT NULL DEFAULT '0',
  `BS` int(11) NOT NULL DEFAULT '0',
  `HOLD` int(11) NOT NULL DEFAULT '0',
  `POSITION` varchar(45) NOT NULL,
  `CG` int(11) NOT NULL DEFAULT '0',
  `HIT_DATE` date NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=1468 DEFAULT CHARSET=utf8 COMMENT='Daily Raw Baseball Data';
